import React from "react";
import Note from "../Note/Note";

function NoteContainer() {
  return (
    <div>
      <Note
        note={{
          text: "hsdgvu",
          time: "4:32AM",
          color: "cyan",
        }}
      />
    </div>
  );
}
export default NoteContainer;
